import Vue from 'vue'
import Vuex from 'vuex'

Vue.use(Vuex)

export default new Vuex.Store({
  state: {
    schedule: [
      {
        date: '5 feb',
        teams: 'u1 u1',
        place: 'kil'

      }, {
        date: '3 ene',
        teams: 'u2uu2',
        place: 'london'

      }]

  },
  mutations: {
    cambiarFecha: state => {
      state.schedule.forEach(fecha => {
        fecha.date = '0'
      })
    }

  },
  actions: {

  }
})
